import React from "react";
import { Box, Button, Text } from "@chakra-ui/react";

function App() {
  return (
    <Box p={4} textAlign="center">
      <Text fontSize="xl">Welcome to Chakra UI</Text>
      <Button colorScheme="teal" mt={4}>
        Get Started
      </Button>
    </Box>
  );
}

export default App;
